import React, { useRef, useEffect, useState } from 'react';
import mapboxgl from 'mapbox-gl';
import 'mapbox-gl/dist/mapbox-gl.css';
import { Box, Typography } from '@mui/material';

// Set the Mapbox access token
// Using a public token for testing
mapboxgl.accessToken = 'pk.eyJ1IjoibWFwYm94IiwiYSI6ImNpejY4M29iazA2Z2gycXA4N2pmbDZmangifQ.-g_vE53SD2WrJ6tFX7QHmA';

// For debugging
console.log('Mapbox token set:', mapboxgl.accessToken);
console.log('Mapbox version:', mapboxgl.version);

const OpportunityMap = ({ neighborhoods }) => {
  const mapContainerRef = useRef(null);
  const [map, setMap] = useState(null);
  const [mapError, setMapError] = useState(null);

  // Check if WebGL is supported
  const checkWebGLSupport = () => {
    if (!mapboxgl.supported()) {
      setMapError('Your browser does not support WebGL, which is required for the map to work.');
      return false;
    }
    return true;
  };

  // Initialize map when component mounts
  useEffect(() => {
    if (!mapContainerRef.current) return;
    if (!checkWebGLSupport()) return;

    console.log('Initializing map, container exists:', !!mapContainerRef.current);

    try {
      // Create the map instance
      const mapInstance = new mapboxgl.Map({
        container: mapContainerRef.current,
        style: 'mapbox://styles/mapbox/light-v11', // Use a simpler style
        center: [-73.97, 40.75], // NYC coordinates
        zoom: 10,
        attributionControl: true
      });

      // Add navigation controls
      mapInstance.addControl(new mapboxgl.NavigationControl());

      // Add a marker to verify the map is working
      new mapboxgl.Marker({ color: '#F00' })
        .setLngLat([-73.97, 40.75])
        .addTo(mapInstance);

      console.log('Map created successfully');

      // Set the map state once it's loaded
      mapInstance.on('load', () => {
        console.log('Map loaded event fired');
        setMap(mapInstance);

        // Add neighborhoods data if available
        if (neighborhoods) {
          addNeighborhoodsToMap(mapInstance, neighborhoods);
        }
      });

      // Clean up on unmount
      return () => {
        mapInstance.remove();
      };
    } catch (error) {
      console.error('Error creating map:', error);
      setMapError(`Error creating map: ${error.message}`);
    }
  }, []);

  // Update map when neighborhoods data changes
  useEffect(() => {
    if (!map || !neighborhoods) return;

    console.log('Neighborhoods data changed, updating map');
    addNeighborhoodsToMap(map, neighborhoods);
  }, [map, neighborhoods]);

  // Function to add neighborhoods data to the map
  const addNeighborhoodsToMap = (mapInstance, data) => {
    console.log('Adding neighborhoods to map, features:', data.features?.length);

    try {
      // Check if the source already exists
      if (mapInstance.getSource('neighborhoods')) {
        console.log('Updating existing source');
        mapInstance.getSource('neighborhoods').setData(data);
      } else {
        console.log('Adding new source and layers');

        // Add the neighborhoods data source
        mapInstance.addSource('neighborhoods', {
          type: 'geojson',
          data: data
        });

        // Add fill layer
        mapInstance.addLayer({
          id: 'neighborhood-fills',
          type: 'fill',
          source: 'neighborhoods',
          paint: {
            'fill-color': [
              'interpolate',
              ['linear'],
              ['get', 'opportunityScore'],
              0, '#f7fbff',
              2, '#d0e1f2',
              4, '#94c4df',
              6, '#4a98c9',
              8, '#1764ab',
              10, '#08306b'
            ],
            'fill-opacity': 0.7
          }
        });

        // Add outline layer
        mapInstance.addLayer({
          id: 'neighborhood-borders',
          type: 'line',
          source: 'neighborhoods',
          paint: {
            'line-color': '#000',
            'line-width': 1
          }
        });

        // Add hover effects
        const popup = new mapboxgl.Popup({
          closeButton: false,
          closeOnClick: false
        });

        mapInstance.on('mouseenter', 'neighborhood-fills', (e) => {
          mapInstance.getCanvas().style.cursor = 'pointer';

          if (e.features.length > 0) {
            const properties = e.features[0].properties;
            const coordinates = e.lngLat;

            const html = `
              <strong>${properties.name}</strong><br/>
              Opportunity Score: ${properties.opportunityScore}<br/>
              School Quality: ${properties.schoolQuality}<br/>
              ${properties.description}
            `;

            popup.setLngLat(coordinates).setHTML(html).addTo(mapInstance);
          }
        });

        mapInstance.on('mouseleave', 'neighborhood-fills', () => {
          mapInstance.getCanvas().style.cursor = '';
          popup.remove();
        });
      }
    } catch (error) {
      console.error('Error adding neighborhoods to map:', error);
      setMapError(`Error adding neighborhoods: ${error.message}`);
    }
  };

  return (
    <Box sx={{ width: '100%', height: '100%', position: 'relative' }}>
      {mapError ? (
        <Box sx={{ p: 3, textAlign: 'center', color: 'error.main' }}>
          <Typography variant="body1">Error: {mapError}</Typography>
        </Box>
      ) : (
        <div 
          ref={mapContainerRef} 
          style={{ 
            width: '100%', 
            height: '100%', 
            minHeight: '500px',
            position: 'absolute',
            top: 0,
            left: 0,
            right: 0,
            bottom: 0,
            background: '#f8f9fa' // Light background to show the container is there
          }}
        />
      )}
    </Box>
  );
};

export default OpportunityMap;
